import logo from './logo.svg';
import './App.css';
import Layout from'./rent/home.js';
import { BrowserRouter, Routes, Route } from "react-router-dom";
function App() {
  return (
    <>
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout/>} />
        </Routes>
    </BrowserRouter>

    </>
  )
}

export default App;
